    Ts=timestamp(2)-timestamp(1);

    %%%%% calculate tau, fz, theta and lc %%%%%%
    s1.l_t0 = 205.7796;s1.r_t0 = 209.0839; 
    s2.l_t0 = 223.6281;s2.r_t0 = 222.3360;
